import React from "react";
import SoundCoverImage from "../../../assets/SoundCoverImage.png";
import { Image } from "react-native";
import { Container, ScreenArea, CoverArea, PlayerArea } from "./styles";
import TopBar from "../../components/TopBar";
const Play = () => {
  return (
    <Container>
      <TopBar />
      <ScreenArea>
        <CoverArea>
          <Image resizeMode="contain" source={SoundCoverImage} />
        </CoverArea>
        <PlayerArea></PlayerArea>
      </ScreenArea>
    </Container>
  );
};

export default Play;
